import styled from 'styled-components';
import QuestionItemNum from './KimQuestionItemNum';

const QuestionItemCard = styled.div`
    margin-top: 20px;
    margin-bottom: 20px;
    background-color: green;
`;

const QuestionItemTitle = styled.div`
    font-size: 27px;
    font-weight: bold;
`;

const QuestionItemSelectBox = styled.div`
    display: flex;
`;

export default function QuestionItem(props) {
    return (
      <>
        <QuestionItemCard>
            <QuestionItemTitle>{props.title}</QuestionItemTitle>
            <QuestionItemSelectBox>
                <form>
                    <input type='radio' name='check1'></input>
                    <input type='radio' name='check2'></input>
                    <input type='radio' name='check3'></input>
                </form>
            </QuestionItemSelectBox>
        </QuestionItemCard>
      </>
    );
}
